function Works2() {
  return (
    <div className="section-padding pt-0">
      <div className="container">
        <div className="img">
          <img src="/light/assets/imgs/works/projects/3/6.jpg" alt="" />
        </div>
      </div>
    </div>
  );
}

export default Works2;
